import { useParams } from "react-router-dom";
import * as apis from "../../api";
const Playlist = () => {
  const { title, pid } = useParams();
  const [playList, setplayList] = useState();

  useEffect(() => {
    const fetchDataPlayList = async () => {
      const reponse = await apis.apiGetDetailPlayList(pid);
      setplayList(reponse)
    };
    fetchDataPlayList();
  }, [pid]);

